import React from 'react';
import { Link } from 'react-router-dom';
import { motion } from 'framer-motion';

const PropertyCard = ({ property }) => {
  const { 
    _id, 
    title, 
    description, 
    price,
    listingType, 
    propertyType, 
    area, 
    bedrooms, 
    bathrooms, 
    location,
    images 
  } = property;

  // Format price with commas and currency symbol
  const formatPrice = (price) => {
    return new Intl.NumberFormat('en-US', {
      style: 'currency',
      currency: 'USD',
      maximumFractionDigits: 0,
    }).format(price);
  };

  // Default image if none provided
  const imageUrl = images && images.length > 0 
    ? images[0] 
    : 'https://via.placeholder.com/400x300?text=No+Image+Available';

  return (
    <motion.div 
      whileHover={{ y: -5 }}
      className="card overflow-hidden flex flex-col h-full"
    >
      <div className="relative overflow-hidden aspect-w-16 aspect-h-9">
        <Link to={`/properties/${_id}`}>
          <img 
            src={imageUrl} 
            alt={title} 
            className="w-full h-64 object-cover transition-transform duration-500 hover:scale-105"
          />
          <div className="absolute top-4 left-4">
            <span className={`inline-block px-3 py-1 text-xs font-semibold rounded-full ${
              listingType === 'rent' 
                ? 'bg-secondary-500 text-white' 
                : 'bg-primary-500 text-white'
            }`}>
              {listingType === 'rent' ? 'For Rent' : 'For Sale'}
            </span>
          </div>
        </Link>
      </div>

      <div className="p-5 flex-grow flex flex-col">
        <div className="mb-4">
          <div className="flex justify-between items-start mb-1">
            <h3 className="text-lg font-semibold text-neutral-900 flex-grow truncate">
              <Link to={`/properties/${_id}`} className="hover:text-primary-600">
                {title}
              </Link>
            </h3>
            <span className="text-lg font-bold text-primary-600">
              {formatPrice(price)}
              {listingType === 'rent' && <span className="text-sm text-neutral-500">/mo</span>}
            </span>
          </div>
          <p className="text-sm text-neutral-500 mb-4 line-clamp-2">
            {location.address}, {location.city}
          </p>
        </div>

        <div className="border-t border-neutral-100 pt-4 mt-auto">
          <div className="flex items-center justify-between text-sm text-neutral-500">
            <div className="flex items-center">
              <svg xmlns="http://www.w3.org/2000/svg" className="h-5 w-5 mr-1 text-neutral-400" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={1.5} d="M3 12l2-2m0 0l7-7 7 7M5 10v10a1 1 0 001 1h3m10-11l2 2m-2-2v10a1 1 0 01-1 1h-3m-6 0a1 1 0 001-1v-4a1 1 0 011-1h2a1 1 0 011 1v4a1 1 0 001 1m-6 0h6" />
              </svg>
              <span>{propertyType}</span>
            </div>
            <div className="flex items-center">
              <svg xmlns="http://www.w3.org/2000/svg" className="h-5 w-5 mr-1 text-neutral-400" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={1.5} d="M4 8V4m0 0h4M4 4l5 5m11-1V4m0 0h-4m4 0l-5 5M4 16v4m0 0h4m-4 0l5-5m11 5l-5-5m5 5v-4m0 4h-4" />
              </svg>
              <span>{area} sq ft</span>
            </div>
            <div className="flex items-center">
              <svg xmlns="http://www.w3.org/2000/svg" className="h-5 w-5 mr-1 text-neutral-400" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={1.5} d="M15 12a3 3 0 11-6 0 3 3 0 016 0z" />
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={1.5} d="M2.458 12C3.732 7.943 7.523 5 12 5c4.478 0 8.268 2.943 9.542 7-1.274 4.057-5.064 7-9.542 7-4.477 0-8.268-2.943-9.542-7z" />
              </svg>
              <span>{bedrooms} bd</span>
            </div>
            <div className="flex items-center">
              <svg xmlns="http://www.w3.org/2000/svg" className="h-5 w-5 mr-1 text-neutral-400" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={1.5} d="M8 14v3m4-3v3m4-3v3M3 21h18M3 10h18M3 7l9-4 9 4M4 10h16v11H4V10z" />
              </svg>
              <span>{bathrooms} ba</span>
            </div>
          </div>
        </div>
      </div>
    </motion.div>
  );
};

export default PropertyCard;
